import React from 'react';
import { createStackNavigator } from "react-navigation-stack";
import { createAppContainer } from 'react-navigation';
import Home from "../screens/HomePage";
import UpcomingShows from "../screens/UpcomingShows";
import Waitlist from "../screens/WaitList";
import GladiatorsLandingPage from '../screens/GladiatorsLandingPage';
import Store from "../screens/Store";


const screens = {
    Home: {
        screen: Home,
        navigationOptions: {
            title: "WheelHouse"
        }
    },

    UpcomingShows: {
        screen: UpcomingShows,
        navigationOptions: {
            title: "WheelHouse",
            headerStyle: {backgroundColor: "rgba(37,37,37,255)"}
        }
    },

    Waitlist: {
        screen: WaitList,
        navigationOptions: {
            title: "WheelHouse"
        }
    },

    GladiatorsOfSteel: {
        screen: GladiatorsLandingPage,
        navigationOptions: {
            title: "Gladiators Of Steel"
        }
    },

    Store: {
        screen: Store,
        navigationOptions: {
            title: "Store"
        }
    }

}

const HomeStack = createStackNavigator(screens, {
    defautNavigationOptions: {
        headerStyle: {backgroundColor: "rgba(37,37,37,255)"}
    }
});

export default HomeStack;
